  false,\n\t\"url\": null,\n\t\"notes\": \"Within the Nulhegan basin lies the Nulhegan
  Deer Wintering Area, an approximately 15,000-acre tract of land. In addition to
  being the largest deer wintering area in Vermont, this tract is also home to several
  boreal species uncommon in the state, such as the black-backed woodpecker, gray
  jay, and spruce grouse; the only known breeding population of spruce grouse in Vermont
  occurs here. This plan outlines the goals, objectives and strategies for managing
  this tract of land, balancing the various interests of conservationists and foresters.\",\n\t\"license_title\":
